import React, {useEffect} from 'react';
import { Base } from "../../components/Base";
import CSSProps from "../../data/constants/CSSProps";


const About = () => {
  useEffect(()=>{
    Base.prototype.SwitchPage(CSSProps.ID.About);
  });
  return (
    <div>
        About
    </div>
  );
};

export default About;
